let store = {
  _state: {
    contentPage: {
      posts: [
        {
          id: 1,
          message: 'Hello',
          ava: 'data:image/png;base64,'
        },
        {
          id: 2,
          message: 'How are you?',
          ava: 'data:image/jpeg;base64,'
        }
      ],
      newPostText: 'dorozhnik'
    },
    dialogsPage: {
      dialogs: [
        {name: 'Andrey', id: 1, message: ''},
        {name: 'Vika', id: 2, message: ''},
        {name: 'Seryi', id: 3, message: ''},
        {name: 'Kolya', id: 4, message: ''}
      ],
      avatars: [
        {avatar: 'data:image/jpeg;base64,', alt: 'ava-1'},
        {avatar: 'data:image/jpeg;base64,', alt: 'ava-2'},
        {avatar: 'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSaqiRAB9a6nxIGBFSUKbjw2IqbEjpzuOKyAA&usqp=CAU', alt: 'ava-3'},
        {avatar: 'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcTMpxngDzweK9PjrcBaBt1eTTL6dymJAz1Tjw&usqp=CAU', alt: 'ava-4'}
      ],
      newDialogText: 'Freedom'
    }
  },
  getState() {
    return this._state;
  },
  _callSubscriber()  {
    console.log('State has changed');
  },
  addPost() {

    let newPost = {
      id: 1,
      message: this._state.contentPage.newPostText,
      ava: 'data:image/jpeg;base64,'
    }
    this._state.contentPage.posts.push(newPost);
    this.updateNewPostText('');
    this._callSubscriber(this._state);
  },
  updateNewPostText(newText) {

    this._state.contentPage.newPostText = newText;
    this._callSubscriber(this._state);
  },
  sendMessage() {

    let newMessage = {
      name: 'Vasya',
      id: 1,
      message: this._state.dialogsPage.newDialogText,
    }
    this._state.dialogsPage.dialogs.push(newMessage);
    this.updateNewDialogText('');
    this._callSubscriber(this._state);
  },
  updateNewDialogText(newText) {

    this._state.dialogsPage.newDialogText = newText;
    this._callSubscriber(this._state);
  },
  subscribe(observer) {
    this._callSubscriber = observer;
  }
}

window.store = store;

export default store;
